inline long power(long x, long y, long m)
{
    if (y == 0)
        return 1;
    long p = power(x, y / 2, m) % m;
    p = (p * p) % m;

    return (y % 2 == 0) ? p : (x * p) % m;
}

inline long modInverse(long a, long m)
{
    return power(a, m - 2, m);
}

vector<vector<int>> generateMatrixU_transpose(int n, const int q = 65537)
{
    cout << "Generating MatrixU ... " << n << endl;
    vector<vector<int>> U(n, vector<int>(n));
    for (int i = 0; i < n; i++)
    {
        for (int j = 0; j < n; j++)
        {
            if (i == 0)
            {
                // U[0][j]=g^jmodq
                U[i][j] = (int)power(3, j, q);
            }
            else if (i == n / 2)
            {
                // U[n/2][j]=U[0][j]^1modq
                U[i][j] = (int)modInverse(U[0][j], q);
            }
            else
            {
                // U[i][j]=(U[i1][j])^3modq
                U[i][j] = (int)power(U[i - 1][j], 3, q);
            }
        }
    }
    cout << "Generation MatrixU finished. " << endl;
    return U;
}

void writeUtemp(const vector<uint64_t> U_temp, const int i)
{
    ofstream datafile;
    datafile.open("data/U_temp/" + to_string(i) + ".txt");

    for (size_t i = 0; i < U_temp.size(); i++)
    {
        datafile << U_temp[i] << "\n";
    }
    datafile.close();
}

vector<uint64_t> readUtemp(const int i, const int degree=32768) {
    ifstream datafile;
    datafile.open ("data/U_temp/" + to_string(i) + ".txt");

    vector<uint64_t> U_temp(degree);
    
    for(size_t i = 0; i < U_temp.size(); i++){
        datafile >> U_temp[i];
    }
    datafile.close();

    return U_temp;
}

Ciphertext slotToCoeff(std::unique_ptr<EvaluatorBfvBase> &evaluator,  BatchEncoder &batch_encoder, 
                       vector<Ciphertext>& ct_sqrt_list, vector<Plaintext>& U_plain_list,
                       const GaloisKeys& gal_keys, const int sq_rt = 128, const int degree=32768) {

    chrono::high_resolution_clock::time_point time_start, time_end;
    int total_mul = 0;

    vector<Ciphertext> result(sq_rt);
    // result[i] = j ct_sqrt_list[j]U[i][j]
    for (int iter = 0; iter < sq_rt; iter++) {
        for (int j = 0; j < (int) ct_sqrt_list.size(); j++) {
            time_start = chrono::high_resolution_clock::now();
            if (j == 0) {
                evaluator->multiply_plain(ct_sqrt_list[j], U_plain_list[iter * ct_sqrt_list.size() + j], result[iter]);
            } else {
                Ciphertext temp;
                evaluator->multiply_plain(ct_sqrt_list[j], U_plain_list[iter * ct_sqrt_list.size() + j], temp);
                evaluator->add(result[iter], temp, result[iter]);
            }
            time_end = chrono::high_resolution_clock::now();
            total_mul += chrono::duration_cast<chrono::microseconds>(time_end - time_start).count();
        }
    }

    // 
    for (int i = 0; i < (int) result.size(); i++) {
        evaluator->transform_from_ntt_inplace(result[i]);
    }

    //  + 
    for (int iter = sq_rt-1; iter > 0; iter--) {
        evaluator->rotate_row(result[iter], result[iter], 1, gal_keys);
        evaluator->add_inplace(result[iter-1], result[iter]);
    }

    return result[0];
}

